import { CFooter } from '@coreui/react'

const AppFooter = () => {
  return (
    <CFooter>
      <div>
        <a href="https://coreui.io" target="_blank" rel="noopener noreferrer">
          CoreUI
        </a>
        <span className="ms-1">1ยบ GTT - 2023</span>
      </div>

    </CFooter>
  )
}

export default React.memo(AppFooter)
